  true,\n\t\"url\": null,\n\t\"notes\": \"The Sea Level Rise Impacts on Ramsar Wetlands
  of International Importance data set represents the results of an analysis using
  the boundaries for Ramsar sites designated under the Ramsar Convention on Wetlands
  and intersecting them with different elevation zones in the coastal zone to assess
  area and percent area that would become inundated under 1 and 2 meter sea level
  rise scenarios. This data set provides results for 613 sites with defined boundaries
  that were found to intersect with the 0-5m above mean sea level coastal zone, defined
  by NASA Shuttle Radar Topography Mission (SRTM) elevation data. In addition to assessing
  the degree of risk of inundation, the data set provides data on population density
  and percent of land that is urban within the site and within 1km and 5km buffers
  surrounding the site. The data set also reports on infant mortality rates within
  1km and 5km buffers around the site, as a measure of poverty levels that may affect
  adaptive capacity.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
